$.validator.methods.range=function(n,t,i){var r=n.replace(",",".");return this.optional(t)||r>=i[0]&&r<=i[1]};$.validator.methods.number=function(n,t){return this.optional(t)||/^-?(?:\d+|\d{1,3}(?:[\s\.,]\d{3})+)(?:[\.,]\d+)?$/.test(n)};$.validator.methods.date=function(n,t){if(!n)return!1;var i=n.split(" "),r=i[0].split("."),u=(i.length==2?i[1]:"0:0:0").split(":");return this.optional(t)||!/Invalid|NaN/.test(new Date(r[2],r[1],r[0],u[0],u[1],u[2],0))};